import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box, Typography, Button, Stack, Breadcrumbs, Link, Tabs, Tab, Grid, Paper
} from '@mui/material';
import { useAccessibility } from '../../context/AccessibilityContext';
import productos from '../../data/productos.json';

export default function Detalle() {
  const { id } = useParams();
  const { altoContraste } = useAccessibility();
  const [tabIndex, setTabIndex] = useState(0);

  const producto = productos.find(p => String(p.id) === id);

  if (!producto) {
    return (
      <Box sx={{ mt: 8, px: 4 }}>
        <Typography variant="h6" color="error">Producto no encontrado</Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ mt: 6, px: 4, maxWidth: '1000px', mx: 'auto', color: altoContraste ? '#fff' : '#000' }}>
      {/* Breadcrumb */}
      <Breadcrumbs separator="›" sx={{ mb: 3 }}>
        <Link href="/" color={altoContraste ? '#ffd900' : '#2e7d32'}>Inicio</Link>
        <Link href={`/productos/${producto.categoria.toLowerCase()}`} color={altoContraste ? '#ffd900' : '#2e7d32'}>
          {producto.categoria}
        </Link>
        <Typography>{producto.nombre}</Typography>
      </Breadcrumbs>

      <Grid container spacing={4}>
        {/* Imagen del producto */}
        <Grid item xs={12} md={5}>
          <Paper elevation={3} sx={{ borderRadius: 4, overflow: 'hidden' }}>
            <img
              src={producto.imagen}
              alt={producto.nombre}
              style={{ width: '100%' }}
            />
          </Paper>
        </Grid>

        {/* Detalles del producto */}
        <Grid item xs={12} md={7}>
          <Typography variant="h4" fontWeight="bold" gutterBottom>
            {producto.nombre}
          </Typography>

          <Typography variant="h6" color={altoContraste ? '#ffd900' : '#2e7d32'} gutterBottom>
            {producto.tipo || producto.subtipo || producto.categoria}
          </Typography>

          <Stack direction="row" spacing={2} sx={{ mt: 2, mb: 3 }}>
            {producto.botones?.map((btn, index) => (
              <Button
                key={index}
                variant="contained"
                href={btn.url}
                target="_blank"
                sx={{
                  bgcolor: altoContraste ? '#ffd900' : '#f7931e',
                  color: altoContraste ? '#000' : '#fff',
                  fontWeight: 'bold',
                  px: 3,
                  '&:hover': {
                    bgcolor: altoContraste ? '#ffeb3b' : '#d76d00'
                  }
                }}
              >
                {btn.label}
              </Button>
            ))}
          </Stack>
        </Grid>
      </Grid>

      {/* Tabs tipo Descripción / Tipo / Subtipo / Presentaciones / Modo de uso */}
      <Box sx={{ mt: 4 }}>
        <Tabs
          value={tabIndex}
          onChange={(_, newIndex) => setTabIndex(newIndex)}
          textColor="inherit"
          indicatorColor="primary"
          variant="scrollable"
        >
          <Tab label="Descripción" />
          <Tab label="Tipo" />
          <Tab label="Subtipo" />
          <Tab label="Presentaciones" />
          <Tab label="Modo de uso" />
        </Tabs>

        <Box sx={{ mt: 2 }}>
          {tabIndex === 0 && (
            <Typography variant="body1" sx={{ lineHeight: 1.8 }}>
              {producto.descripcion}
            </Typography>
          )}
          {tabIndex === 1 && (
            <Typography variant="body1">{producto.tipo || 'No especificado'}</Typography>
          )}
          {tabIndex === 2 && (
            <Typography variant="body1">{producto.subtipo || 'No especificado'}</Typography>
          )}
          {tabIndex === 3 && (
            <Typography variant="body1">{producto.presentaciones || 'No especificado'}</Typography>
          )}
          {tabIndex === 4 && (
            <Typography variant="body1">{producto.modoDeUso || 'No especificado'}</Typography>
          )}
        </Box>
      </Box>
    </Box>
  );
}
